import React from 'react';

// AdminClassesView - Giao diện adminclasses cho admin (View trong MVC)
const AdminClassesView: React.FC = () => {
  return (
    <div className="max-w-6xl mx-auto">
      <div className="mb-6">
        <h1 className="text-3xl font-bold text-gray-900 mb-2">Class Management</h1>
        <p className="text-gray-600">Create and manage class sections</p>
      </div>

      <div className="card">
        <div className="text-center py-12">
          <h3 className="text-lg font-medium text-gray-900 mb-2">Class Sections</h3>
          <p className="text-gray-600">This page will allow admins to manage class sections with enrollment tracking and lecturer assignments.</p>
        </div>
      </div>
    </div>
  );
};

export default AdminClassesView;
